CREATE DATABASE NUXIBA;

USE NUXIBA;



CREATE TABLE LOG_DIAL(
	ID_LLAMADA		VARCHAR(10) NOT NULL PRIMARY KEY,
	FECHA_LLAMADA	DATE NOT NULL,
	TIEMPO_DIALOGO	SMALLINT NOT NULL,
	TELEFONO		VARCHAR(10) NOT NULL,
	ID_TIPO_LLAMADA	SMALLINT NOT NULL
	);

CREATE TABLE COSTOS(
	ID_TIPO_LLAMADA	SMALLINT NOT NULL PRIMARY KEY,
	TIPO_LLAMADA	VARCHAR(15) NOT NULL,
	COSTOS			DECIMAL(10,4)  NOT NULL
	);
	
ALTER TABLE LOG_DIAL ADD CONSTRAINT FK_COSTO FOREIGN KEY (ID_TIPO_LLAMADA)
REFERENCES COSTOS (ID_TIPO_LLAMADA);


